import * as React from 'react';
export class IgrTemplateContent extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        if (!this.props.template) {
            return null;
        }
        let ele = React.createElement(this.props.template, { dataContext: this.props.dataContext });
        return ele;
    }
}
